import React from 'react'
import {
    Link
} from "react-router-dom";

const buttonStyleBig = {
    fontFamily: 'Lato',
    border: 'none',
    height: '100px',
    width: '200px',
    borderRadius: '50px',
    fontSize: '20px',
    color: '#3b035f',
    backgroundImage: 'linear-gradient(to right, var(--main4) , var(--main5))'
};

class Button extends React.Component {
    render(size, to) {
        let style = buttonStyleBig
        if(size === "big") {
            let style = buttonStyleBig
        }
        return <Link to={to} style={style}/>
    }
}

export default Button
